file = """

""".strip()

def shrink(file):
    progress = True
    while progress:
        progress = False
        file = iter(file)
        last = next(file)
        skip = False
        new_file = []
        for c in file:
            if c.lower() == last.lower() and c != last:
                progress = True
                last = next(file, '')
                continue
            new_file.append(last)
            last = c
        new_file.append(last)
        file = new_file
    return file


def part1(file):
    return len(shrink(file))


def part2(file):
    shrunk = ''.join(shrink(file))
    return min(
        len(shrink(shrunk.replace(c, '').replace(c.upper(), '')))
        for c in set(shrunk.lower())
    )



print(part1(file))
print(part2(file))
